svg.script:
        function showHide(id){
            document.getElementById("scavecgraph").style.display = "none";
            document.getElementById("solution").style.display = "none";
            document.getElementById("gaze").style.display = "none";
        
            document.getElementById("admin").style.display = "none";
            document.getElementById("repos").style.display = "none";
            document.getElementById("tasking").style.display = "none";
            document.getElementById("specs").style.display = "none";
            document.getElementById("resources").style.display = "none";
            document.getElementById("studios").style.display = "none";
            document.getElementById("channels").style.display = "none";
            document.getElementById("portals").style.display = "none";

            document.getElementById("bg-admin").style.stroke = "#0178af";
            document.getElementById("bg-repos").style.stroke = "#0178af";
            document.getElementById("bg-tasking").style.stroke = "#0178af";
            document.getElementById("bg-specs").style.stroke = "#0178af";
            document.getElementById("bg-resources").style.stroke = "#0178af";
            document.getElementById("bg-studios").style.stroke = "#0178af";
            document.getElementById("bg-channels").style.stroke = "#0178af";
            document.getElementById("bg-portals").style.stroke = "#0178af";
                
            document.getElementById("icon-admin").style.fill = "#0178af";
            document.getElementById("icon-repos").style.fill = "#0178af";
            document.getElementById("icon-tasking").style.fill = "#0178af";
            document.getElementById("icon-specs").style.fill = "#0178af";
            document.getElementById("icon-resources").style.fill = "#0178af";
            document.getElementById("icon-studios").style.fill = "#0178af";
            document.getElementById("icon-channels").style.fill = "#0178af";
            document.getElementById("icon-portals").style.fill = "#0178af";
        
            document.getElementById(id).style.display = "block";
            document.getElementById("bg-" + id).style.stroke = "#63acce";        
            document.getElementById("icon-" + id).style.fill = "#63acce";
        
        }
        function reset(){
            document.getElementById("scavecgraph").style.display = "block";
            document.getElementById("solution").style.display = "block";        
            document.getElementById("gaze").style.display = "block";
        
            document.getElementById("admin").style.display = "none";
            document.getElementById("repos").style.display = "none";
            document.getElementById("tasking").style.display = "none";
            document.getElementById("specs").style.display = "none";
            document.getElementById("resources").style.display = "none";
            document.getElementById("studios").style.display = "none";
            document.getElementById("channels").style.display = "none";
            document.getElementById("portals").style.display = "none";	
        
            document.getElementById("bg-admin").style.stroke = "#0178af";
            document.getElementById("bg-repos").style.stroke = "#0178af";
            document.getElementById("bg-tasking").style.stroke = "#0178af";
            document.getElementById("bg-specs").style.stroke = "#0178af";
            document.getElementById("bg-resources").style.stroke = "#0178af";
            document.getElementById("bg-studios").style.stroke = "#0178af";
            document.getElementById("bg-channels").style.stroke = "#0178af";
            document.getElementById("bg-portals").style.stroke = "#0178af";        
        
            document.getElementById("icon-admin").style.fill = "#0178af";
            document.getElementById("icon-repos").style.fill = "#0178af";
            document.getElementById("icon-tasking").style.fill = "#0178af";
            document.getElementById("icon-specs").style.fill = "#0178af";
            document.getElementById("icon-resources").style.fill = "#0178af";
            document.getElementById("icon-studios").style.fill = "#0178af";
            document.getElementById("icon-channels").style.fill = "#0178af";
            document.getElementById("icon-portals").style.fill = "#0178af";
        }
